import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container c1">
      <div className="glow"></div>
      <div className="header">
        <h1 className="logo">JSX</h1>
        <ul>
          <li><a href="">abc</a></li>
          <li><a href="">def</a></li>
          <li><a href="">ghi</a></li>
          <li><a href="">jkl</a></li>
        </ul>
      </div>
    </div>
  );
}

export default App;
